import React, { Component } from 'react';
import logo from './../logo.svg';
import './App.css';
import { Grid, Row, Col } from 'react-bootstrap';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Grid>
          <Row>
            <Col xs={0} md={4}>
            </Col>
            <Col xs={12} md={4}>
              <Panel onClick={handleClick}>
                <Panel.Body>Basic panel example</Panel.Body>
              </Panel>
            </Col>
            <Col xs={0} md={4}>
            </Col>
          </Row>
        </Grid>
      </div>
    );
  }
}

export default App;
